import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';

let postsDt = [
  {id: '1', post: 'Hi, how are u?', likes: '12'},
  {id: '2', post: 'Hi, everybody!', likes: '36'},
  {id: '3', post: 'OK. And u?', likes: '26'}
]

let dialoguesDt = [
  {id: '1', name: 'Мария'},
  {id: '2', name: 'Антон'},
  {id: '3', name: 'Мартин'},
  {id: '4', name: 'Алексей'},
  {id: '5', name: 'Евгения'}
]

let messagesDt = [
  {id: '1', message: 'Hi!'},
  {id: '2', message: 'How r u?'},
  {id: '3', message: 'OK. And you?'}
]

const root = ReactDOM.createRoot(document.getElementById('root'));

root.render(
  <React.StrictMode>
    <App posts={postsDt} dialogues={dialoguesDt} messages={messagesDt} />
  </React.StrictMode>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
